import React, { Component } from "react";
import Link from "next/link";
import Router from "next/router";

const indexPage = () => {
	return (
		<div>
			<h1>The Main Page</h1>
			<p>
				Go to the{" "}
				<Link href='/auth'>
					<a>Auth</a>
				</Link>
				<button onClick={() => Router.push("/auth")}>Go to Auth</button>
			</p>
		</div>
	);
};

export default indexPage;
